*Concept*
In the modern world, human craves for everything high-tech and Trendy, blinded from the damage being done to the planet and its Inhabitants. The fashion industry is contributing to pollution is taking us close to the climate crisis. Technological advancement in the textile and fashion industry will make life easy but existence difficult. We need to dive into the past to regulate a sustainable future. We need to find solution in nature, History, and art. I want to communicate my outlook on sustainable fashion, Indian heritage textile, and Handicrafts through this Wearable art. I came across the Sikki craft of Bihar back in 2016. I was surprised by the precision, the intricacy of handcrafted Sikki products. ''Sikki" is a raw material used to make Sikki products, it is derived from nature. Its fascinating how it can be molded into various shapes and forms. Its versatility inspired me to design Avant-garde and Fashion accessories, keeping in mind the local forms as it is easiest to help connect with artisans when we look at common things for inspiration. The banana plantation is something very common in this area and is considered very auspicious. I took inspiration from banana Plant and its elements. 

